import React from "react";
import { Scatter } from "react-chartjs-2";

const TestGraph = (props) => {
  const entries = props.entriesByDate;

  const testData = entries.map((entry) => (entry.time, entry.attendee_count))
  console.log(testData)

  const state = {
    // labels: [-20, 20],
    datasets: [
      {
        backgroundColor: "rgba(75,192,192,1)",
        borderColor: "rgba(0,0,0,1)",
        borderWidth: 2,
        data: [
            {
              x: 12,
              y: 30,
            },
            {
              x: 12.25,
              y: 120,
            },
            {
              x: 13,
              y: 70,
            },
          ],
      },
    ],
  };

  return (
    <div>
      <Scatter
        data={state}
        options={{
          title: {
            display: true,
            text: "Attendee counts over time",
            fontSize: 20,
          },
          legend: {
            display: false,
          },
          scales: {
            // xAxes: [
            //   {
            //     labels: [-30, 30],
            //     type: "linear",
            //     ticks: {
            //       max: -30,
            //       min: 40,
            //       stepSize: 10,
            //     },
            //   },
            // ],
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                },
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default TestGraph;
